column8:
　かおりちゃんブランドでお馴染み！「宇治森徳」のお茶屋さんの石鹸シリーズ。農薬不使用の特別栽培茶エキスを配合したお肌にやさしい石鹸です。洗顔にもお使いいただけます。<br><br><table width="450" border="1" cellpadding="3" cellspacing="0" bordercolor="#CDCDCD" style="font-size:12px">  <tr bgcolor="#CEE8FB">    <td colspan="2" align="left"><div align="left">商品番号 <b>kaori001</b></div></td>  </tr>  <tr>    <td width="80" align="left" bgcolor="#f3f3f3">商品名</td>    <td align="left"> 緑茶石鹸</td>  </tr>  <tr>    <td width="80" align="left" bgcolor="#f3f3f3">内容量</td>    <td align="left"> 95g</td>  </tr>  <tr>    <td width="80" align="left" bgcolor="#f3f3f3">成分</td>    <td align="left"> 石ケン素地・グリセリン・スクロース・ソルビトール・チャエキス・PEG-75・水・エタノール・エチドロン酸・香料・EDTA－4Na・銅クロロフィリンNa</td>  </tr>  <tr>    <td width="80" align="left" bgcolor="#f3f3f3">備考</td>    <td align="left">   ・特別栽培茶エキスを配合したお肌にやさしい石鹸です。 <br>  ・洗顔にもお使いいただけます。 <br>  ・洗い上がりのやさしさをお試し下さい。<br>   ※お肌に異常があった場合はご使用を中止してください。    </td>  </tr>  <tr>    <td width="80" align="left" bgcolor="#f3f3f3">広告文責</td>    <td align="left"> 株式会社ドリームwebシステム　050-3821-6873</td>  </tr>  <tr>    <td width="80" align="left" bgcolor="#f3f3f3">区分</td>    <td align="left"> 石けん</td>  </tr></table><br><br><br><img src="/smilehouse/cabinet/ntop/henpin_nomi.gif"><!--注意事項--><br><br><!--注意事項end--><style type="text/css">

